import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import Button from '@materialui-core';

import ThreatMap from './ThreatMap';

function App(){
  return(
    <Router>
      <div>
        <Button color="primary" component={RouterLink} to="/network-threat-map">
          Network incidents near you
        </Button>
        <Switch>
          <Route path='/network-threat-map'>
            <ThreatMap />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
